function jsResponseResult(a){this.Status=false;this.Message="";this.HaveMessage=false;this.Data=null;this.Fillset=null;this.idq=null;this.TargetID=null;this.parseResult=function(b){if(typeof b=="object"){if(b){if(typeof b.status=="boolean"){this.Status=b.status}if(typeof b.message=="string"){this.Message=b.message}}}};this.parse=function(b){this.Status=false;this.Message="";this.Data=null;if(typeof b=="object"){if(b){this.parseResult(b);if(typeof b.result=="object"){this.parseResult(b.result)}if(typeof b.data!="undefined"){this.Data=b.data}if(typeof b.fillset!="undefined"){this.Fillset=b.fillset}if(typeof b.idq=="string"){this.idq=b.idq}if(typeof b.target_id=="string"){this.TargetID=b.target_id}}}else{if(typeof b=="string"){this.Message=b.replace(/^#[a-zA-Z]*#/gi,"")}}this.HaveMessage=((this.Message.length)?true:false)};this.parse(a)};